import { Text, View,Image} from 'react-native';
import styled from 'styled-components/native'


const sss = styled.Text`
padding:15px
`

const Navbar = () =>{
    return(<View>
        <sss>Hello</sss>
        <Image source={require('../../assets/images/home.png')}/>
    </View>)
}



export default Navbar;
